# Sample Document Style 1
# This sample document style can be used as a template for creating custom document styles. This sample does not utilise language translation.
# Configure document options e.g. page size, margins, default font, page orientation
# It is recommended to use a web safe system font. If the configured font is not installed on the
# system from which the report is viewed then a substitute font will be used. This may not result
# in the desired look of the document
DocumentOption -EnableSectionNumbering -PageSize A4 -DefaultFont 'Trebuchet MS' -MarginLeftAndRight 71 -MarginTopAndBottom 71 -Orientation $Orientation

# Title & Heading Styles
Style -Name 'Title' -Size 24 -Color 'F30E0D' -Align Center -Bold
Style -Name 'Title 2' -Size 18 -Color '223F8C' -Align Center
Style -Name 'Title 3' -Size 12 -Color 'FDDA00' -Align Center
Style -Name 'Heading 1' -Size 16 -Color 'F30E0D'
Style -Name 'Heading 2' -Size 14 -Color '223F8C'
Style -Name 'Heading 3' -Size 12 -Color 'FDDA00'
Style -Name 'Heading 4' -Size 11 -Color '6BADE6'
Style -Name 'NO TOC Heading 4' -Size 11 -Color '6BADE6'
Style -Name 'Heading 5' -Size 10 -Color '6BADE6'
Style -Name 'NO TOC Heading 5' -Size 10 -Color '6BADE6'
Style -Name 'Heading 6' -Size 9 -Color '6BADE6'
Style -Name 'NO TOC Heading 6' -Size 9 -Color '6BADE6'
Style -Name 'NO TOC Heading 7' -Size 9 -Color '6BADE6' -Italic
Style -Name 'Normal' -Size 10 -Color '000000' -Default
# Header & Footer Styles
Style -Name 'Header' -Size 10 -Color '000000' -Align Center
Style -Name 'Footer' -Size 10 -Color '000000' -Align Center
# Table of Contents Style
Style -Name 'TOC' -Size 16 -Color 'F30E0D'
# Table Heading & Row Styles
Style -Name 'TableDefaultHeading' -Size 10 -Color 'F30E0D' -BackgroundColor 'FDDA00'
Style -Name 'TableDefaultRow' -Size 10 -Color '000000'
Style -Name 'TableDefaultAltRow' -Size 10 -Color '000000' -BackgroundColor 'EAEAE6'
# Table Row/Cell Highlight Styles
Style -Name 'Critical' -Size 10 -Color 'FFFFFF' -BackgroundColor 'F30E0D' -Bold -Italic
Style -Name 'Warning' -Size 10 -Color 'FFFFFF' -BackgroundColor '223F8C' -Bold -Italic
Style -Name 'Info' -Size 10 -Color '000000' -BackgroundColor 'FDDA00' -Bold -Italic
Style -Name 'OK' -Size 10 -Color '000000' -BackgroundColor '73BF1F' -Bold -Italic
# Table Caption Style
Style -Name 'Caption' -Size 10 -Color '000000' -Align Center

# Default Table Style Properties
$TableDefaultProperties = @{
    Id = 'TableDefault'
    HeaderStyle = 'TableDefaultHeading'
    RowStyle = 'TableDefaultRow'
    AlternateRowStyle = 'TableDefaultAltRow'
    BorderColor = 'F30E0D'
    Align = 'Center'
    CaptionStyle = 'Caption'
    CaptionLocation = 'Below'
    BorderWidth = 0.25
    PaddingTop = 1
    PaddingBottom = 1.5
    PaddingLeft = 2
    PaddingRight = 2
}

# Table Styles
TableStyle @TableDefaultProperties -Default
TableStyle -Id 'Borderless' -HeaderStyle Normal -RowStyle Normal -BorderWidth 0

# Cover Page Layout
# Set Header & Footer, if enabled in report JSON configuration
if ($ReportConfig.Report.ShowHeaderFooter) {
    Header -Default {
        Paragraph -Style Header "$($ReportConfig.Report.Name) - v$($ReportConfig.Report.Version)"
    }

    Footer -Default {
        Paragraph -Style Footer 'Page <!# PageNumber #!>'
    }
}

# Set position of cover page image, report titles and other information based on page orientation
if (-not ($ReportConfig.Report.ShowCoverPageImage)) {
    # If cover page image is disabled, set report title position
    if ($Orientation -eq 'Portrait') {
        BlankLine -Count 20
        $LineCount = 25
    } else {
        BlankLine -Count 10
        $LineCount = 15
    }
} else {
    if ($Orientation -eq 'Portrait') {
        $LineCount = 19
    } else {
        $LineCount = 1
    }
}

# Show Logo image, if enabled in report JSON configuration
if ($ReportConfig.Report.ShowCoverPageImage) {
    Try {
        Image -Text 'Sample 1 Logo' -Align Center -Percent 100 -Base64 ""
    } Catch {
        Write-PScriboMessage -IsWarning -Message "Cover page images are not supported for reports generated on Linux or macOS."
    }
}

# Add Report Name
# Position Report Name
BlankLine -Count 2
Paragraph -Style Title $ReportConfig.Report.Name

# Add Company Name if specified
if ($AsBuiltConfig.Company.FullName) {
    # Position Company Name
    BlankLine -Count 1
    Paragraph -Style Title2 $AsBuiltConfig.Company.FullName
    BlankLine -Count $LineCount
} else {
    BlankLine -Count ($LineCount + 1)
}

# Add Paragraph Runs
Paragraph {
    Text 'Website:' -Font 'Trebuchet MS' -Size 10 -Bold -Color '223F8C'
    Text 'www.LosPollosHermanos.com' -Font 'Trebuchet MS' -Size 10 -Bold -Color 'F30E0D'
}
Paragraph {
    Text 'Locations:' -Font 'Trebuchet MS' -Size 10 -Bold -Color '223F8C'
    Text 'New Mexico, Arizona, Utah, Colorado' -Font 'Trebuchet MS' -Size 10 -Bold -Color 'F30E0D'
}
PageBreak

# Add Table of Contents
if ($ReportConfig.Report.ShowTableOfContents) {
    TOC -Name 'Table of Contents'
    PageBreak
}